                    <div className = "top">hi! i'm Aditya </div><br/>
                    <div className = "bottom"> Cloud & DevOps Enthusiast <br/><br/>  AWS Cloud + Terraform @ pvl </div>

                </div>
                <div className="intro-pic">

                    <img src={me} alt="drawing of Aditya Khot"></img>

                </div>
            </div>

            {/* project list */}
            <Projects />
        </>
    );
}
